import ExpenseItem from "./ExpenseItem";

function Expenses(prop) {
    return (
        <div className="expense">
            <ExpenseItem 
                title={prop[0].title} 
                amount={prop[0].amount} 
                date={prop[0].date}>
            </ExpenseItem>
            <ExpenseItem 
                title={prop[1].title} 
                amount={prop[1].amount} 
                date={prop[1].date}>
            </ExpenseItem>
            <ExpenseItem 
                title={prop[2].title} 
                amount={prop[2].amount} 
                date={prop[2].date}>
            </ExpenseItem>
            <ExpenseItem 
                title={prop[3].title} 
                amount={prop[3].amount} 
                date={prop[3].date}>
            </ExpenseItem>
        </div>
    )
}

export default Expenses;
